var MD5 = require('md5');
var Config = require('../Config');

var getToken = function() {
    var clientId = 'XF0005',
        clientSecret = MD5('blissmall'),
        timestamp = new Date().getTime(),
        sign = MD5(clientId + clientSecret + timestamp);

    var params = {
        clientId: clientId,
        clientSecret: clientSecret,
        timestamp: timestamp,
        sign: sign
    };

    $.ajax({
        url: Config.APIGATEWAY + '/api/common/getToken',
        type: 'POST',
        contentType: "application/json", //这个必须有
        data: JSON.stringify(params),
        dataType: "json",
    }).done(function(jsonobj) {
        var count = localStorage.count,
            token = jsonobj.data.token;

        localStorage.authorization = token;
        localStorage.count = !token && count ? ++count : 0;

        // 防止token获取为空 导致页面频繁刷新
        if(!token && localStorage.count < 3 || token) {
            location.reload();
        }
    })
};

module.exports = getToken;


